    value: This report is being amended in response to the Commissions letter dated
      February 28, 2013.  The Commission requested information regarding credit card
      payments disclosed on Line 21(b).  In particular one payment appeared to not
      contain sufficient itemizations on Schedule B.  Upon further review a clerical
      error was found.  A payment to Wells Fargo Card Services was disclosed for $27,436.58;
      however the correct amount was $2,736.58.  The entry has been corrected and
      is amended here.  All original vendors aggregating in excess of $200 have been
      disclosed on Schedule B.  This correction affects Lines 21(b) and 8 of the Summary
      pages.  Subsequent reports will be amended to correct the totals on their Summary
      pages.    All disbursements for NEGOP FUNDRAISING EVENT EXPENSE and NEGOP EVENT
      EXPENSE were for fundraising purposes for the state party only; no federal candidate
      or federal officeholder was identified in any of these events. Non-federal funds
      were not used in connection with any federal election or federal election activity.  Disbursements
      for employees who spend less than 25% of their time on Federal-election related
      activities are allocated as administrative expense.  No payments are listed
      for rent as the Party owns the building from which it operates and therefore
      has no rent payments.
